result:
  .common-table {
    background: none;
  }

  .search {
    position: absolute;
    top: 5px;
    right: 16px;
    height: 26px;
    line-height: 26px;
    width: 200px;
    border-radius: 2px;
    border-width: 1px;
    border-style: solid;
    .icon-serach {
      margin: 0 10px;
    }

    .search-input {
      line-height: 26px;
      border: none;
      width: 165px;
    }

    input:
    :-webkit-input-placeholder {
      color: #515A6B;
    }
  }
  .table-body td .rose-label {
    display: inline-block;
    width: 70px;
    height: 24px;
    text-align: center;
    line-height: 24px;
    padding: 0;
  }
  .table-body td .symbolName, .table-body td .icon-btn {
    padding: 0;
    vertical-align: inherit;
    margin: 0;
    display: inline-block;
  }
  .table-body td .symbolName {
    width: 80%;
    margin-left: 10px;
  }

  .fontSize14 {
    font-size: 14px;
  }

.inter-tableContent{
  width: 1180px;
  margin: 0 auto 0 auto;
}
